import React from "react";
import { TTodo } from "../types";
import { useFilteredTodos } from "../hooks/useFilteredTodos";

type FiltersProps = {
  handleChangeComplete: (
    value: ((prevState: TTodo[]) => TTodo[]) | TTodo[]
  ) => void;
};

export default function Filters({ handleChangeComplete }: FiltersProps) {
  return (
    <div>
      <h1>Filters</h1>
      <div>
        <h2>Completed</h2>
        <label>
          <input
            type="checkbox"
            onChange={(event) => handleChangeComplete(event.target.checked)}
          />
          <span>Completed</span>
        </label>
        <label>
          <input type="checkbox" />
          <span>Not Completed</span>
        </label>
      </div>
    </div>
  );
}
